function Cart() {
  const Freyja = 8;
  const Tyrael = 10;
  const pack = 15;

  return (
    <ul>
      <li>Freyja : {Freyja}</li>
      <li>Tyrael : {Tyrael}</li>
      <li>pack : {pack}</li>
      <li>Total : {Freyja + Tyrael + pack}</li>
    </ul>
  );
}

export default Cart;
